import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: auto;
  display: flex;
  box-shadow: 5px 5px 5px 5px var(--line-gray);
  padding: 1rem;
`;

const SelectBox = styled.ul`
  width: 50%;
  height: 40px;
  overflow-y: scroll;
  li {
    overflow-y: scroll;
  }
`;

export default function TimePicker() {
  const timeArr = Array.from({ length: 24 }, (_, i) => i + 1);
  return (
    <Container>
      <div>시작 시간</div>
      <SelectBox>
        {timeArr.map((item: number, key: number) => {
          return (
            <li value={String(item)} key={key}>
              {`${item} : 00`}
            </li>
          );
        })}
      </SelectBox>
    </Container>
  );
}
